<script type="text/javascript">
    function openPopup(url, windowName, windowFeatures) {
    // Open a new window with the specified URL, name, and features
    let newWindow = window.open(url, windowName, windowFeatures);

    // Optional: Focus the new window if it successfully opened
    if (newWindow && newWindow.focus) {
        newWindow.focus();
    }

    return false; // Prevent default link behavior if called from an anchor tag
    }

    // Example usage:
    // Open a popup to a specific URL with defined dimensions
    
    
    // Or, to open a blank popup that you can then populate with content:
